          public ActionResult GASTOS_PESSOAL_MENSAL_COMP(string Pesquisa_User = "", string desativa_datatable = "", string Empresa = "", string Perfil = "")
          {
              string IdentifyUser = User.Identity.Name;
              string caracter = "#";
              int Identifycaracter = IdentifyUser.IndexOf(caracter);
              var IdentifyLength = IdentifyUser.Length - Identifycaracter;
              var User1 = IdentifyUser.Substring(0, Identifycaracter);
              var Conexao = IdentifyUser.Substring(Identifycaracter + 1, IdentifyLength - 1);
              APLICACAOEntities2 zz = new APLICACAOEntities2(Conexao);

            var f = zz.PROC_BI_SELECCAO_VERSAO_USER(Pesquisa_User, Empresa, Perfil).ToList();
            var versao_real = f.Where(c => c.id_seleccao_calc.Contains("VERSAO_REAL_DFS") || c.user.Contains(Pesquisa_User)).Select(c => c.versao_selec).FirstOrDefault();
            var versao_ante = f.Where(c => c.id_seleccao_calc.Contains("VERSAO_ANTE_DFS") || c.user.Contains(Pesquisa_User)).Select(c => c.versao_selec).FirstOrDefault();


            ViewData["versao_real"] = versao_real;
            ViewData["versao_ante"] = versao_ante;
            ViewData["desativa_datatable"] = desativa_datatable;

            string tabela_dados = "BI_DADOS_001";
            string dic_dados = "";
            string id_parametro_ANO = "ANO";
            string id_parametro_MES = "MES";

            ViewBag.LISTA_MESES_REAL = zz.PROC_BI_LISTA_MESES(tabela_dados, dic_dados, id_parametro_ANO, id_parametro_MES, versao_real).ToList();
            ViewBag.LISTA_MESES_ANTE = zz.PROC_BI_LISTA_MESES(tabela_dados, dic_dados, id_parametro_ANO, id_parametro_MES, versao_ante).ToList();

